package pinyin

import (
	"github.com/KercyLAN/secret-dimension-core/cipher"
	"github.com/KercyLAN/secret-dimension-core/compress"
	"strconv"
	"strings"
)

var (
	// 韵母表
	rhymes []rune
	// 韵母声调表
	rhymeTones [][]rune
	// 韵母和韵母声调映射
	rhymeTonesMapping map[rune]rune
	// 韵母和声调顺序映射
	rhymeTonesOrderMapping map[rune]int
	// 拼音词典
	pinyinDictionary map[rune]string
)

// 模板变量
var (
	// 声母
	templateInitials []string
	// 韵母
	templateRhyme []string
)

func init() {
	// 初始化变量
	{
		rhymeTonesMapping = make(map[rune]rune)
		rhymeTonesOrderMapping = make(map[rune]int)
		pinyinDictionary = make(map[rune]string)
	}
	// 初始化词典
	var pinyinBunch string
	{
		pinyinBunch = ""
	}
	// 初始化模板
	{
		templateInitials = []string{
			"zh", "ch", "sh",
			"b", "p", "m", "f", "d", "t", "n", "l", "g", "k", "h", "j", "q", "x", "r", "z", "c", "s", "y", "w",
		}
		templateRhyme = []string{
			"ang", "eng", "ing", "ong",
			"ai", "ei", "ui", "ao", "ou", "iu", "ie", "ve", "er", "an", "en", "in", "un", "vn",
			"a", "o", "e", "i", "u", "v",
		}
	}
	// 初始化韵母
	{
		// 构建韵母数组和韵母四个声调的对应数组
		rhymes = []rune{'a', 'e', 'i', 'o', 'u', 'v', 'A', 'E', 'I', 'O', 'U', 'V'}
		rhymeTones = [][]rune{
			{'ā', 'ē', 'ī', 'ō', 'ū', 'ǖ', 'Ā', 'Ē', 'Ī', 'Ō', 'Ū', 'Ǖ'},
			{'á', 'é', 'í', 'ó', 'ú', 'ǘ', 'Á', 'É', 'Í', 'Ó', 'Ú', 'Ǘ'},
			{'ǎ', 'ě', 'ǐ', 'ǒ', 'ǔ', 'ǚ', 'Ǎ', 'Ě', 'Ǐ', 'Ǒ', 'Ǔ', 'Ǚ'},
			{'à', 'è', 'ì', 'ò', 'ù', 'ǜ', 'À', 'È', 'Ì', 'Ò', 'Ù', 'Ǜ'},
		}
		// 取到每一组声调数组，i表示四个声调的位置
		for i, rhymeTone := range rhymeTones {
			// 取到声调和声调的位置
			for j, tone := range rhymeTone {
				// 如 ā : a , á : a
				rhymeTonesMapping[tone] = rhymes[j]
				// 如 ā : 1 , á : 2 , ē : 1
				rhymeTonesOrderMapping[tone] = i + 1
			}
		}
	}
	// 词典解析
	{
		// 解码并取到每一行
		byte, err := cipher.Base64Decoded(pinyinBunch)
		if err != nil {
			panic(err)
		}
		byte, err = compress.GZipUnCompress(byte)
		if err != nil {
			panic(err)
		}
		lines := strings.Split(string(byte), "\n")
		// 遍历所有行开始解析
		for _, line := range lines {
			// key and value || 3400=>qiū || 3400, qiū
			KV := strings.Split(line, "=>")
			if len(KV) < 2 {
				continue
			}
			key, err := strconv.ParseInt(KV[0], 16, 32)
			if err != nil {
				panic(err)
			}
			pinyinDictionary[rune(key)] = KV[1]
		}
	}
}
